import React from 'react'
import { NavLink } from 'react-router-dom'

export const Product = () => {
  return (
    <div className='prod'>
        <NavLink to="/saree">Saree</NavLink>
        <NavLink to="/west-tern">West-tern</NavLink>
    </div>
  )
}
